func TestDirectFormFIRFilter1(t *testing.T) {
	f, err := NewDffirFromJSON(f1)
	if err != nil {
		t.Fatal(err)
	}

	x, err := util.GetSignalFromJSON(s)
	if err != nil {
		t.Fatal(err)
	}

	yRef, err := util.GetSignalFromJSON(y1)
	if err != nil {
		t.Fatal(err)
	}

	y, err := f.Filter(x)
	if err != nil {
		t.Fatal(err)
	}

	if !util.IsAlmostEqual(y, yRef) {
		t.Fatal("filtered signal does not match reference signal")
	}
}

